css:
.auto-cursor {
  cursor: default;
}
kite-members-list {
  flex-direction: column;
}
kite-members-list ul {
  width: 100%;
  padding-right: 0 !important;
  margin-top: 0 !important;
  display: flex;
  flex-direction: column;
}
kite-members-list li {
  padding-bottom: 10px;
}
kite-members-list li p {
  margin-bottom: 0;
}
kite-members-list .character-match {
  color: #d7dae0;
}
kite-members-list header.settings-view {
  flex-direction: column;
  padding: 10px 20px;
  background: #31363f;
}
kite-members-list header.settings-view .row {
  display: flex;
  flex-direction: row;
  margin-bottom: 5px;
}
kite-members-list header.settings-view .row atom-text-editor[mini] {
  font-size: 1em;
  flex: 1 1 0;
  background: #1b1d23;
  border: 1px solid #181a1f;
  border-radius: 3px;
}
kite-members-list header.settings-view .row select.form-control {
  margin-left: 0.25em;
  width: auto;
  flex: 0 0 auto;
  font-size: 1.1em;
}
kite-members-list header.settings-view .members-count {
  margin-bottom: 10px;
}
kite-members-list .members-list {
  flex: 1 1 0;
  overflow-y: auto;
  padding: 10px 20px;
}
kite-members-list .members-list .split-line .name {
  flex: 1 1 auto;
  overflow: hidden;
  text-overflow: ellipsis;
}
kite-members-list .members-list .split-line .type {
  flex: 0 0 auto;
}
